// Function to normalize input data (accepting int array and converting to float)
int normalize_input_data(int* input_data, int size, float* output_data) {
  if (size == 0) {
    return 1;
  }

  int min_value = input_data[0];
  int max_value = input_data[0];

  // Find min and max values
  for (int i = 1; i < size; i++) {
    if (input_data[i] < min_value) min_value = input_data[i];
    if (input_data[i] > max_value) max_value = input_data[i];
  }


  if (min_value == max_value) {
    return 1;
  }


  // Normalize to float range [0, 1]
  for (int i = 0; i < size; i++) {
    output_data[i] = ((float) input_data[i] - min_value) / (max_value - min_value);
  }

  return 0;
}

// ReLU activation function
float relu(float x) {
  return (x > 0) ? x : 0.0f;
}

// Sigmoid activation function
float sigmoid(float x) {
  return 1.0f / (1.0f + exp(-x));
}

// Dot product function
void dot_product(const float* inputs, const float weights[][HIDDEN_LAYER_SIZE], const float* biases, float* outputs, int input_size, int output_size) {
    for (int i = 0; i < output_size; ++i) {  // Iterate over the neurons
        float dot = 0.0f;

        for (int j = 0; j < input_size; ++j) {
            dot += inputs[j] * weights[j][i];  // Compute the dot product
        }

        dot += biases[i];  // Add the bias
        outputs[i] = dot;  // Store the result
    }
}

void dot_product(const float* inputs, const float weights[][OUTPUT_SIZE], const float* biases, float* output, int input_size) {
    float dot = 0.0f;
    for (int j = 0; j < input_size; ++j) {
        dot += inputs[j] * weights[j][0];  // Compute the dot product
    }
    dot += biases[0];  // Add the bias
    *output = dot;     // Store the result
}

// Classification function (now accepts an array of integers)
bool classify(int* input_data, int size) {
    if (size != INPUT_SIZE) {
        std::cout << "Error: Input data size mismatch.\n";
        return false;
    }

    // Step 1: Normalize Input Data (converting to float)
    float normalized_input_data[INPUT_SIZE];
    normalize_input_data(input_data, size, normalized_input_data);

    // Step 2: Hidden layer calculation
    float hidden_layer_output[HIDDEN_LAYER_SIZE];
    dot_product(normalized_input_data, weights_hidden, biases_hidden, hidden_layer_output, INPUT_SIZE, HIDDEN_LAYER_SIZE);

    // Apply ReLU activation to hidden layer
    for (int i = 0; i < HIDDEN_LAYER_SIZE; i++) {
        hidden_layer_output[i] = relu(hidden_layer_output[i]);
    }

    // Step 3: Output layer calculation
    float output = 0.0f;
    dot_product(hidden_layer_output, weights_output, biases_output, &output, HIDDEN_LAYER_SIZE);

    // Apply Sigmoid activation
    float probability = sigmoid(output);

    // Classify based on probability
    return probability > 0.5f;
}